export const REQUEST_API_DATA = "REQUEST_API_DATA";
export const RECEIVE_API_DATA = "RECEIVE_API_DATA";
export const requestApiData = () => ({ type: REQUEST_API_DATA });
export const receiveApiData = data => ({ type: RECEIVE_API_DATA, data });

export const REQUEST_API_POST_DATA = "REQUEST_API_POST_DATA";
export const RECEIVE_API_POST_DATA = "RECEIVE_API_POST_DATA";
export const requestApiPost_Data = () => ({ type: REQUEST_API_POST_DATA });
export const receiveApiPost_Data = data => ({ type: RECEIVE_API_POST_DATA, data });
